import { POST_DATA } from "../actions";

export default function(state = null, action) {
  switch (action.type) {
    // case FETCH_DATA:
    //   return action.payload.data;
    case POST_DATA :
      return action.payload
    default :
    // console.log("state",state)

      return state;
  }
}
